INSERT INTO `ost_content` (`id`, `isactive`, `type`, `name`, `body`, `notes`, `created`, `updated`) VALUES
(1, 1, 'landing', 'Landing', '<h1>Selamat Datang di </h1> <h1>IPR Support Ticket System</h1> <p>Untuk mempermudah permintaan support di lingkungan IPR dan melayani Anda dengan lebih baik, kami menggunakan IPR Support Ticket System. Setiap permintaan dukungan diberikan nomor tiket unik yang dapat Anda gunakan untuk melacak progress dan response secara online. Untuk referensi Anda, kami menyediakan arsip lengkap dan riwayat semua permintaan dukungan Anda. Alamat email yang valid diperlukan untuk mengirimkan tiket. </p> <p>Untuk bantuan lebih lanjut silahkan langsung menghubungi Departement IT-IPR.</p> <p><br />Terima Kasih.</p> <p>Admin IPR Support Ticket System</p>', '<p>The Landing Page refers to the content of the Customer Portal\'s initial view. The template modifies the content seen above the two links <strong>Open a New Ticket</strong> and <strong>Check Ticket Status</strong>.</p>', '2020-08-28 11:30:27', '2020-08-28 14:22:57'),
(2, 1, 'thank-you', 'Thank You', '<div>%{ticket.name}, <br /> <br /> Terima kasih sudah menggunakan IPR Support Ticket System. <br /> <br />Tiket permintaan support sudah dibuat, mohon tunggu feedback selanjutnya dari pihak terkait.</div><div><br /></div><div>Terima Kasih.<br /> <br /> <br /> Admin IPR Support Ticket System.</div>', '<p>This template defines the content displayed on the Thank-You page after a Client submits a new ticket in the Client Portal.</p>', '2020-08-28 11:30:27', '2020-08-28 14:32:26'),
(3, 1, 'offline', 'Offline', '<div><h1><span style=\"font-size:medium\">IPR SUPPORT TICKET SYSTEM OFFLINE</span></h1> <p>Mohon maaf atas ketidaknyamanannya.</p> <p>Saat ini IPR Support Ticket System kami sedang offline, silahkan coba beberapa saat lagi.</p> <p>Terima Kasih.</p> </div>', '<p>The Offline Page appears in the Customer Portal when the Help Desk is offline.</p>', '2020-08-28 11:30:28', '2020-08-28 14:27:36'),
(4, 1, 'registration-staff', 'Selamat Datang Di IPR Support Ticket System', '<h3><strong>Hi %{recipient.name.first},</strong></h3> <div>Kami sudah membuat akun untuk anda agar dapat masuk di IPR Support Ticket System %{url}.<br /> <br />Silahkan klik link berikut untuk konfirmasi akun anda dan memulai untuk membuat tiket.<br /> <br /> <a href=\"%%7Blink%7D\">%{link}</a><br /> <br /> <em style=\"font-size:small\">Hormat Kami Admin IPR Support Ticket System<br /> %{company.name}</em> </div>', 'This template defines the initial email (optional) sent to Agents when an account is created on their behalf.', '2020-08-28 11:30:28', '2020-08-28 15:30:41'),
(5, 1, 'pwreset-staff', 'IPR Support Ticket System Staff Password Reset', '<h3><strong>Hi %{staff.name.first},</strong></h3> <div>A password reset request has been submitted on your behalf for the helpdesk at %{url}.<br /> <br /> If you feel that this has been done in error, delete and disregard this email. Your account is still secure and no one has been given access to it. It is not locked and your password has not been reset. Someone could have mistakenly entered your email address.<br /> <br /> Follow the link below to login to the help desk and change your password.<br /> <br /> <a href=\"%%7Blink%7D\">%{link}</a><br /> <br /> <em style=\"font-size:small\">Your friendly Customer Support System</em> <br /> <figure><img src=\"cid:b56944cb4722cc5cda9d1e23a3ea7fbc\" alt=\"Powered by osTicket\" width=\"126\" height=\"19\" style=\"width:126px\" data-image=\"459bngqj69kc\" /></figure> </div>', 'This template defines the email sent to Staff who select the <strong>Forgot My Password</strong> link on the Staff Control Panel Log In page.', '2020-08-28 11:30:28', '2020-08-28 15:31:15'),
(6, 1, 'banner-staff', 'Authentication Required', '<p>Selamat Datang di Login User IPR Support Ticket System</p>', 'This is the initial message and banner shown on the Staff Log In page. The first input field refers to the red-formatted text that appears at the top. The latter textarea is for the banner content which should serve as a disclaimer.', '2020-08-28 11:30:28', '2020-08-28 14:59:43'),
(7, 1, 'registration-client', 'Welcome to %{company.name}', '<h3><strong>Hi %{recipient.name.first},</strong></h3> <div> We\'ve created an account for you at our help desk at %{url}.<br /> <br /> Please follow the link below to confirm your account and gain access to your tickets.<br /> <br /> <a href=\"%{link}\">%{link}</a><br /> <br /> <em style=\"font-size: small\">Your friendly Customer Support System <br /> %{company.name}</em> </div>', 'This template defines the email sent to Clients when their account has been created in the Client Portal or by an Agent on their behalf. This email serves as an email address verification. Please use %{link} somewhere in the body.', '2020-08-28 11:30:28', '2020-08-28 11:30:28'),
(8, 1, 'pwreset-client', '%{company.name} Help Desk Access', '<h3><strong>Hi %{user.name.first},</strong></h3> <div> A password reset request has been submitted on your behalf for the helpdesk at %{url}.<br /> <br /> If you feel that this has been done in error, delete and disregard this email. Your account is still secure and no one has been given access to it. It is not locked and your password has not been reset. Someone could have mistakenly entered your email address.<br /> <br /> Follow the link below to login to the help desk and change your password.<br /> <br /> <a href=\"%{link}\">%{link}</a><br /> <br /> <em style=\"font-size: small\">Your friendly Customer Support System <br /> %{company.name}</em> </div>', 'This template defines the email sent to Clients who select the <strong>Forgot My Password</strong> link on the Client Log In page.', '2020-08-28 11:30:28', '2020-08-28 11:30:28'),
(9, 1, 'banner-client', 'Silahkan login terlebih dahulu', '<p>Jika anda belum memiliki akun untuk login silahkan daftarkan ke departement IT-IPR</p> <p>Terima kasih</p>', 'This composes the header on the Client Log In page. It can be useful to inform your Clients about your log in and registration policies.', '2020-08-28 11:30:28', '2020-08-28 15:37:13'),
(10, 1, 'registration-confirm', 'Account registration', '<div><strong>Thanks for registering for an account.</strong><br/> <br /> We\'ve just sent you an email to the address you entered. Please follow the link in the email to confirm your account and gain access to your tickets. </div>', 'This templates defines the page shown to Clients after completing the registration form. The template should mention that the system is sending them an email confirmation link and what is the next step in the registration process.', '2020-08-28 11:30:28', '2020-08-28 11:30:28'),
(11, 1, 'registration-thanks', 'Account Confirmed!', '<div> <strong>Thanks for registering for an account.</strong><br /> <br /> You\'ve confirmed your email address and successfully activated your account. You may proceed to open a new ticket or manage existing tickets.<br /> <br /> <em>Your friendly support center</em><br /> %{company.name} </div>', 'This template defines the content displayed after Clients successfully register by confirming their account. This page should inform the user that registration is complete and that the Client can now submit a ticket or access existing tickets.', '2020-08-28 11:30:28', '2020-08-28 11:30:28'),
(12, 1, 'access-link', 'Ticket [#%{ticket.number}] Access Link', '<h3><strong>Hi %{recipient.name.first},</strong></h3> <div> An access link request for ticket #%{ticket.number} has been submitted on your behalf for the helpdesk at %{url}.<br /> <br /> Follow the link below to check the status of the ticket #%{ticket.number}.<br /> <br /> <a href=\"%{recipient.ticket_link}\">%{recipient.ticket_link}</a><br /> <br /> If you <strong>did not</strong> make the request, please delete and disregard this email. Your account is still secure and no one has been given access to the ticket. Someone could have mistakenly entered your email address.<br /> <br /> --<br /> %{company.name} </div>', 'This template defines the notification for Clients that an access link was sent to their email. The ticket number and email address trigger the access link.', '2020-08-28 11:30:28', '2020-08-28 11:30:28');

